		width: number;
		height: number;
		right: number;
		bottom: number;
	};

	constructor(mouseX: number, mouseY: number) {
		super(mouseX, mouseY);
		this.mouseX2 = mouseX;
		this.mouseY2 = mouseY;
	}

	getBoxDimensions() {
		this.dimensions = {
			left: this.mouseX2 > this.mouseX ? this.mouseX : this.mouseX2,
			top: this.mouseY2 > this.mouseY ? this.mouseY : this.mouseY2,
			width: Math.abs(this.mouseX2 - this.mouseX),
			height: Math.abs(this.mouseY2 - this.mouseY),
			right: this.mouseX2 < this.mouseX ? this.mouseX : this.mouseX2,
			bottom: this.mouseY2 < this.mouseY ? this.mouseY : this.mouseY2
		};
		return this.dimensions;
	}

	containsElement({ x, y }: Coords, diagramModel: DiagramModel): boolean {
		const z = diagramModel.getZoomLevel() / 100.0;
		const dimensions = this.getBoxDimensions();

		return (
			x * z + diagramModel.getOffsetX() > dimensions.left &&
			x * z + diagramModel.getOffsetX() < dimensions.right &&
			y * z + diagramModel.getOffsetY() > dimensions.top &&
			y * z + diagramModel.getOffsetY() < dimensions.bottom
		);
	}
}

import { BaseEntity } from '../base.entity';
import { ID, UID } from '../utils/tool-kit.util';

// region events
export class BaseEvent<T extends BaseEntity> {
	entity: T;
	entityId: ID;
	stopPropagation: () => any;
	firing: boolean;
	id: ID;
	propogate: boolean;

	constructor(entity: T, options?: any) {
		this.id = UID();
		this.entity = entity;
		this.entityId = entity.id;
		this.firing = true;
		this.stopPropagation = () => (this.firing = false);
		this.propogate = options ? options.propagate : null;
	}
}
export class LockEvent<T extends BaseEntity = BaseEntity> extends BaseEvent<T> {
	locked: boolean;

	constructor(entity: T, locked: boolean = false) {
		super(entity);
		this.locked = locked;
	}
}
export class ParentChangeEvent<P extends BaseEntity = BaseEntity, T extends BaseEntity = BaseEntity> extends BaseEvent<T> {
	parent: P;

	constructor(entity: T, parent: P) {
		super(entity);
		this.parent = parent;
	}
}
export class SelectionEvent<T extends BaseEntity = BaseEntity> extends BaseEvent<T> {
	isSelected: boolean;

	constructor(entity: T, selected: boolean) {
		super(entity);
		this.isSelected = selected;
	}
}
export class PaintedEvent<T extends BaseEntity = BaseEntity> extends BaseEvent<T> {
	isPainted: boolean;

	constructor(entity: T, painted: boolean = false) {
		super(entity);
		this.isPainted = painted;
	}
}
// endregion

import { Directive, EmbeddedViewRef, Input, TemplateRef, ViewContainerRef } from '@angular/core';

class TemplateVarContext {
	$implicit: any;
	templateVar: any;
}

@Directive({
	selector: '[templateVar]',
})
export class TemplateVarDirective {
	view: EmbeddedViewRef<any>;

	protected context = new TemplateVarContext();

	@Input()
	set templateVar(context: any) {
		this.context.$implicit = this.context.templateVar = context;
		this.updateView();
	}

	constructor(protected vcRef: ViewContainerRef, protected templateRef: TemplateRef<any>) {}

	updateView() {
		if (!this.view) {
			this.vcRef.clear();
			this.view = this.vcRef.createEmbeddedView(this.templateRef, this.context);
		} else {
			this.view.markForCheck();
		}
	}
}

import { ID } from './tool-kit.util';

export interface HashMap<T> {
	[key: string]: T;
}

export type Entries<T> = (readonly [string, T])[];

export class Map<ID, T> extends Map<ID, T> {
	valuesArray(): T[] {
		return Array.from(this.values());
	}
}

import { BehaviorSubject, MonoTypeOperatorFunction, Observable, OperatorFunction } from 'rxjs';
import { distinctUntilChanged, map } from 'rxjs/operators';
import { BaseEntity } from '../base.entity';
import { ID, isArray, mapToEntries } from './tool-kit.util';
import { Entries, HashMap, EntityMap } from './types';

export class ValueStream<T> {
	protected readonly stream$: BehaviorSubject<T>;

	readonly value$: Observable<T>;

	constructor(value?: T, operator?: OperatorFunction<T, any>) {
		this.stream$ = new BehaviorSubject(value);
		this.value$ = operator ? this.stream$.pipe(operator) : this.stream$.asObservable();
	}

	value(): T {
		return this.stream$.getValue();
	}

	set(value: T): ValueStream<T> {
		this.stream$.next(value);
		return this;
	}

	emit(): void {
		this.stream$.next(this.value());
	}

	select(): Observable<T>;
	select(project: (value: T) => T): Observable<T>;
	select<R>(project: (value: T) => R): Observable<R>;
	select<R>(project?: ((value: T) => T) | ((value: T) => R)): Observable<T | R> {
		let mapFn = project || (v => v);
		return this.value$.pipe(
			map(value => mapFn(value)),
			distinctUntilChanged()
		);
	}
}

export function createValueStream<T>(value: T, operator?: OperatorFunction<T, any>): ValueStream<T> {
	return new ValueStream<T>(value, operator);
}

export class MapStream<T extends BaseEntity> extends ValueStream<Map<ID, T>> {
	protected stream$: BehaviorSubject<Map<ID, T>>;

	value$: Observable<Map<ID, T>>;

	constructor(value?: Map<ID, T>, entityPipe?: MonoTypeOperatorFunction<Map<ID, T>>) {
		super(value, entityPipe);
	}

	destroy() {
		this.clear();
		this.stream$ = null;
		this.value$ = null;
	}

	clear(destroy: boolean = true) {
		if (destroy) {
			this.forEach(entity => entity.destroy());
		}

		this.value().clear();
		return this;
	}

	get(id: ID): T {
		return this.value().get(id);
	}

	has(id: ID): boolean {
		return this.value().has(id);
	}

	add(entity: T): MapStream<T> {
		this.value().set(entity.id, entity);
		return this;
	}

	addMany(entities: T[]): MapStream<T> {
		for (const entity of entities) {
			this.add(entity);
		}
		return this;
	}

	remove(id: ID, destroy: boolean = true): MapStream<T> {
		if (destroy) {
			this.value().get(id)?.destroy();
		}

		this.value().delete(id);
		return this;
	}

	array(): T[] {
		return Array.from(this.value().valuesArray());
	}

	array$(): Observable<T[]> {
		return this.select(value => value.valuesArray());
	}

	forEach(cb: (value: T, key: string, map: Map<ID, T>) => void): void {
		this.value().forEach(cb);
	}

	map<R = any>(cb: (value: T, index: number, array: T[]) => R): R[] {
		return this.array().map(cb);
	}
}

export function createMapStream<T extends BaseEntity>(
	value: HashMap<T> | Entries<T> = [],
	entityPipe: MonoTypeOperatorFunction<Map<ID, T>>
): MapStream<T> {
	if (isArray(value)) {
		return new MapStream(new EntityMap(value), entityPipe);
	} else {
		return new MapStream(new EntityMap(mapToEntries(value)), entityPipe);
	}
}

